private void writeNamedList(NamedList nl) throws IOException {
  writeTag(nl instanceof SimpleOrderedMap ? ORDERED_MAP : NAMED_LST, nl.size());
  for (int i = 0; i < nl.size(); i++) {
    String name = nl.getName(i);
    writeStr(name);
    Object val = nl.getVal(i);
    writeVal(val);
  }
}

